import React from 'react';
import './Login.css'; 


const Login = () => {
    return (
      <div className="w-full min-h-screen flex items-start">
        <div className="realative w-1/2 h-full flex flex-col">
            <h1>testando</h1>
        </div>
      </div>
    );
  };
  
  
export default Login;
